import React from "react"
import './ConfirmationBox.css';
class ConfirmationBox extends React.Component {
    render() {
        return( 
        <div>
            <h1>You have purchased {this.props.amount} {this.props.text}</h1>
        </div>
        )
    }
}
export default ConfirmationBox
